current_time = new Date().getTime();
end_time = new Date(msg.payload.time).getTime();
duration = current_time - end_time;




payload = [
    {
		DurationSinceLastBackup: duration,

    },
    {
        BackupName: msg.payload.BackupName
    }
]

msg.payload = payload;
msg.measurement = "LastBackup"

return msg;

